import { LightningElement } from 'lwc';
import { loadStyle, loadScript } from 'lightning/platformResourceLoader';
import JSPDF from '@salesforce/resourceUrl/jsPDF';
import MartelFont from '@salesforce/resourceUrl/MartelFont';
import NotoSansDevanagari from '@salesforce/resourceUrl/NotoSansDevanagari';


export default class JspdfDemo extends LightningElement {

    

    jsPDFLoaded = false;
    fontLoaded = false;

    connectedCallback() {
        if (this.jsPDFLoaded && this.fontLoaded) {
            return;
        }

        // Load both jsPDF library and custom font
        Promise.all([
            loadScript(this, JSPDF), // Load jsPDF
            loadScript(this, `${NotoSansDevanagari}/NotoSansDevanagari/NotoSansDevanagari-Regular.ttf`) // Load the custom font
        ])
        .then(() => {
            this.jsPDFLoaded = true;
            this.fontLoaded = true;
            console.log('jsPDF and custom font loaded successfully.');
        })
        .catch(error => {
            console.error('Error loading resources', error);
        });
    }

    generatePDF() {
        if (!this.jsPDFLoaded) {
            console.error('jsPDF library not loaded yet.');
            return;
        }

        const doc = new window.jspdf.jsPDF(); // Initialize the jsPDF object

        // Embed the Hindi font into the PDF
         doc.addFileToVFS('NotoSansDevanagari-Regular.ttf', this.hindiFontBase64());
         doc.addFont('NotoSansDevanagari-Regular.ttf', 'NotoSansDevanagari', 'normal');
        doc.setFont('NotoSansDevanagari'); // Set the Hindi font
        doc.setFontSize(30);
        doc.text('hello नमस्ते दुनिया, यह हिंदी में एक परीक्षण है।', 10, 10); //नमस्ते दुनिया, यह हिंदी में एक परीक्षण है।
        doc.save("demo.pdf");
    }

    hindiFontBase64() {
        return 
        '';
    }
}